CREATE TABLE m_card(
  id INTEGER NOT NULL,
  member_m_id INTEGER NOT NULL,
  school_idol_no INTEGER NOT NULL,
  card_rarity_type INTEGER NOT NULL,
  card_attribute INTEGER NOT NULL,
  role INTEGER NOT NULL,
  member_card_thumbnail_asset_path TEXT NOT NULL,
  at_gacha INTEGER NOT NULL,
  at_event INTEGER NOT NULL,
  training_tree_m_id INTEGER NOT NULL,
  active_skill_voice_path TEXT NOT NULL,
  sp_point INTEGER NOT NULL,
  exchange_item_id INTEGER NOT NULL,
  role_effect_master_id INTEGER NOT NULL,
  passive_skill_slot INTEGER NOT NULL,
  max_passive_skill_slot INTEGER NOT NULL,
  PRIMARY KEY (id),
  UNIQUE (school_idol_no),
  FOREIGN KEY (member_m_id) REFERENCES m_member(id),
  FOREIGN KEY (training_tree_m_id) REFERENCES m_training_tree(id),
  FOREIGN KEY (role_effect_master_id) REFERENCES m_card_role_effect(id)
);
